import './SinglePost.scss';

const SinglePost = () => {
  return (
    <div className="single-post">
      <div className="single-post__wrapper">
        <img
          src="./images/post.jpg"
          alt="banner"
          className="single-post__image"
        />
        <h1 className="single-post__title">Lorem ipsum dolor sit amet.</h1>
      </div>
    </div>
  );
};

export default SinglePost;
